import './style.css'
export const AnimalContent = ({ text, image , step, childred, className}) => {
    return (
        <div >
            <div className={className}>
                <p className='text-wrapper'>

                    {text}

                </p><a href={`#${step}`} > Вперед к приключениям</a>
            </div>


            <div className={className}>

                    <a name={step}></a>
                    {childred}

            </div>

        </div>
    );
};
